import React, { useState } from 'react';
import TextureCreator from './components/TextureCreator/TextureCreator';
import Sandbox from './components/Sandbox/Sandbox';
import Export from './components/Export/Export';
import './App.css';

function App() {
  const [tileStyles, setTileStyles] = useState<React.CSSProperties>({});

  return (
    <div className="App">
      <header className="App-header">
        <h1>CSS-Tile-Forge</h1>
      </header>
      <main className="App-main">
        <TextureCreator tileStyles={tileStyles} setTileStyles={setTileStyles} />
        <Sandbox tileStyles={tileStyles} />
        <Export tileStyles={tileStyles} />
      </main>
    </div>
  );
}

export default App;
